    public class ThaiKyController : Controller
    {
        public IActionResult Index(int week)
        {
            var userId = HttpContext.Session.GetInt32("UserID");
            if (userId == null)
                return RedirectToAction("Login", "Account");

            if (week < 1 || week > 40)
            {
                ViewBag.ErrorMessage = "Vui lòng nhập tuần thai kỳ hợp lệ (1-40).";
                return View("~/Views/Pregnancy/Index.cshtml", new ThaiKyViewModel());
            }

            var pregnancyData = GetPregnancyData();

            var model = new ThaiKyViewModel
            {
                Week = week,
                Size = pregnancyData[week].Size,
                Weight = pregnancyData[week].Weight,
                Milestone = pregnancyData[week].Milestone,
                Advice = pregnancyData[week].Advice
            };

            return View("~/Views/Pregnancy/Index.cshtml", model);
        }

