            };

            // Sắp xếp dữ liệu theo thứ tự ngày
            var orderedData = data.OrderBy(x => GetDayOrder(x.Key)).ToDictionary(x => x.Key, x => x.Value);
            return View("~/Views/Pregnancy/Nutrition.cshtml", orderedData);
