        private int GetDayOrder(string day)
        {
            var order = new Dictionary<string, int>
            {
                ["Thứ 2"] = 1,
                ["Thứ 3"] = 2,
                ["Thứ 4"] = 3,
                ["Thứ 5"] = 4,
                ["Thứ 6"] = 5,
                ["Thứ 7"] = 6,
                ["Chủ Nhật"] = 7
            };
            return order.ContainsKey(day) ? order[day] : int.MaxValue;
        }

